import React from 'react';
import './FlightOptions.css';

const flightOptions = (props) => {
    return (
        <div className="FlightOptions">
            <div>{props.passengers}</div>
            <div>{props.bags}</div>
            <div>{props.carryOn}</div>
            <div>{props.class}</div>
        </div>
    )
}

export default flightOptions;
